// import stockdata from './Pages/stockdata';
import React from 'react';
import './App.css';
import Navbar from './Components/Navbar';
import Who from './Pages/Who';
import Sale from './Pages/Sale';
import Sign from './Pages/Sign';
import Start from './Pages/Start';
import We from './Pages/We';

export default function App() {
  // const stockget = stockdata.map(stock =>{
  //   return <Stock hre={stock.hre} sr={stock.sr} de={stock.de} des={stock.des} pr = {stock.pr}/>
  // })
  return (
    <>
      <Router>
        <Navbar />
        <Routes>
        <Route exact path='/' element={< Home />}></Route>
        <Route exact path='/' element={< Home />}></Route>
        <Route exact path='/con' element={< Members />}></Route>
        <Route exact path='/acc' element={< Resources />}></Route>
        <Route exact path='/best' element={< WhyUs />}></Route>
        <Route path='*' element={<PagesNotFound />} />
        </Routes>
      </Router>
    </>
  )
}
